Centigo ligger centralt belägget, precis bredvid centralstationen i Stockholm. Rummet Chennai finns på översta våningen i huset. Rummet ligger avskilt belägget längst ner i korridoren, vilket gör att man kan arbeta ostört då få personer går förbi rummet. Rummet har en modern möblering med höga bord som man antingen kan stå eller sitta vid. Rummet har mycket utrymme och man kan enkelt arbete under längre arbetspass i rummet.

Rummet är ett klassiskt konferensrum med plats för upp till 10 sittande personer. Chennai har all tekniska utrustning som behövs för att ert möte ska bli bra så bra som möjligt. Hos Centigo finns också ett kök med tillgång till både kaffe och te.

